define({"topics" : [{"title":"Publish Pipelines Directly","shortdesc":"\n               <p class=\"shortdesc\">When <span class=\"ph\">SDC Edge</span> is         running and is accessible by the <span class=\"ph\">Data Collector</span>         machine, you can use the publish method to deploy edge pipelines to <span class=\"ph\">SDC Edge</span>.\n               </p>\n            ","id":"task_isp_m2f_3db","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelines_Deploy.html#task_isp_m2f_3db","menu": {"hasChildren":false,},"tocID":"task_isp_m2f_3db-d46e107746","topics":[]},{"title":"Export Pipelines","shortdesc":"\n               <p class=\"shortdesc\">If <span class=\"ph\">SDC Edge</span> is not         running or if it is not accessible by the <span class=\"ph\">Data Collector</span>         machine, you must use the export method to deploy edge pipelines to <span class=\"ph\">SDC Edge</span>.\n               </p>\n            ","id":"task_rzb_zgm_pbb","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelines_Deploy.html#task_rzb_zgm_pbb","menu": {"hasChildren":false,},"tocID":"task_rzb_zgm_pbb-d46e107780","topics":[]}]});